O le galuega autu a lefa'avevela laina alavaio le a maeʻa ona galue le chiller mo se vaitaimi, o le a malulu le matagi o le ili, ma o le uaea faʻavevela faʻafefete o le a faʻamalo, ina ia mafai ona faʻateʻaina le vai liusuavai mai le malulu malulu e ala i le paipa paipa.
Talu ai ona o le pito pito i luma o le paipa alavai o loʻo faʻapipiʻiina i totonu o le malulu, o le vai faʻafefe e masani ona faʻamaʻa ona o le siosiomaga i lalo ole 0C, poloka le paipa alavai, o lea e tatau ai ona faʻapipiʻi se
